import React  from "react";
import axios from 'axios';


const Pizza = props =>{
    const [data, setData] = React.useState([]);
    let fetchedData = React.useState([]);
    let datatest = React.useState([]);

    React.useEffect(()=>{
        axios('http://localhost:5000/pizza')
        .then(response=>{
            if(response.status===200){
                const fetchedData =response.data.rows;
                console.log(fetchedData);
                setData(fetchedData);
            }
        })
        .catch(err=>{
            console.log(err);
        })
    },[]);

    const test = () => {
        console.log('TEST')
        axios('http://localhost:5000/pizza')
            .then(response=>{
                if(response.status===200){
                    fetchedData =response.data.rows;
                    for (i in fetchedData){
                        datatest=fetchedData[i]
                        console.log(datatest)
                    }
                    console.log(fetchedData);
                    setData(fetchedData);
                    console.log(fetchedData[1]);
                    return (
                        <div id='fetchedData'>{fetchedData}</div>
                    )
                }
            })
            .catch(err=>{
                console.log(err);
            })
    }

    return(<div>
        Pizza Component
        {
            data.length>0 &&
            data.map((item,index)=>
            <div key={index}>{index}-{item} </div>)
        }
        <button id='button' onClick={test}>TEST</button>
        <div id='fetchedData'></div>

    </div>)
}

export default Pizza;
